      margin: 0;

    h1 {
      margin: 20px 0;
      color: white;
      text-shadow: 1px 1px 2px black;
    }

    #game {
      display: grid;
      grid-template-columns: repeat(3, 100px);
      grid-template-rows: repeat(3, 100px);
      gap: 15px;
      justify-content: center;
      margin: 20px auto;
      position: relative;
    }

    .hole {
      width: 100px;
      height: 100px;
      background-color: #222;
      border-radius: 50%;
      position: relative;
      overflow: hidden;
      cursor: pointer;
      box-shadow: 0 0 10px black;
    }

    .mole-img {
      width: 80px;
      position: absolute;
      bottom: -100px;
      left: 50%;
      transform: translateX(-50%);
      transition: bottom 0.3s ease;
    }

    .up .mole-img {
      bottom: 10px;
    }

    .hammer {
      position: absolute;
      top: -60px;
      left: 50%;
      transform: translateX(-50%) rotate(-45deg);
      font-size: 40px;
      pointer-events: none;
      opacity: 0;
      transition: opacity 0.1s;
    }

    .hit .hammer {
      opacity: 1;
      animation: bonk 0.3s ease;
    }

    @keyframes bonk {
      0% { top: -60px; }
      50% { top: 10px; }
      100% { top: -60px; }
    }

    #hud {
      font-size: 18px;
      margin-top: 10px;
      color: white;
      text-shadow: 1px 1px 2px black;
    }

    #start-btn {
      margin-top: 20px;
      padding: 10px 20px;
      font-size: 16px;
    }

    audio {
      display: none;
    }
  </style>
</head>

    const gameGrid = document.getElementById("game");
    const scoreDisplay = document.getElementById("score");
    const timeDisplay = document.getElementById("time");
    const startBtn = document.getElementById("start-btn");
    const hitSound = document.getElementById("hit-sound");

    let score = 0;
    let time = 60;
    let gameInterval;
    let moleTimers = [];
    let isPlaying = false;

    function createGrid() {
      gameGrid.innerHTML = "";
      for (let i = 0; i < 9; i++) {
        const hole = document.createElement("div");
        hole.classList.add("hole");

        const mole = document.createElement("img");
        mole.classList.add("mole-img");
        mole.src = moleImageBase64;

        const hammer = document.createElement("div");
        hammer.classList.add("hammer");
        hammer.innerText = "🔨";

        mole.addEventListener("click", () => {
          if (!isPlaying || !hole.classList.contains("up")) return;
          score++;
          scoreDisplay.textContent = score;
          hitSound.play();
          hole.classList.remove("up");
          hole.classList.add("hit");
          setTimeout(() => {
            hole.classList.remove("hit");
          }, 300);
        });

        hole.appendChild(mole);
        hole.appendChild(hammer);
        gameGrid.appendChild(hole);
      }
    }

    function randomMole() {
      const holes = document.querySelectorAll(".hole");
      const index = Math.floor(Math.random() * holes.length);
      const hole = holes[index];

      hole.classList.add("up");

      const timer = setTimeout(() => {
        hole.classList.remove("up");
      }, 800);

      moleTimers.push(timer);
    }

    function startGame() {
      if (isPlaying) return;
      isPlaying = true;
      score = 0;
      time = 60;
      scoreDisplay.textContent = score;
      timeDisplay.textContent = time;
      startBtn.disabled = true;

      gameInterval = setInterval(() => {
        if (time <= 0) {
          endGame();
          return;
        }
        randomMole();
        time--;
        timeDisplay.textContent = time;
      }, 1000);
    }

    function endGame() {
      isPlaying = false;
      clearInterval(gameInterval);
      moleTimers.forEach(clearTimeout);
      document.querySelectorAll(".hole").forEach(h => h.classList.remove("up"));
      startBtn.disabled = false;
      alert("Game over! Your score: " + score);
    }

    startBtn.addEventListener("click", startGame);
    createGrid();
  </script>
</body>
</html>
